import "bootstrap/dist/css/bootstrap.min.css"

function App() {

    let count = 0;

    function increase() {
        count += 1;
    }

    return (
        <div className = "container text-center mt-3">
            <h1>React Hooks</h1>
            <hr />
            <h4>Current Value is : {count}</h4>
            <button className = "btn btn-primary"
                    onClick={increase}>
                Increase
            </button>

        </div>

    );
}

export default App;
